import React, {Component} from 'react';

export default class Sidebar extends Component{
    render() {
        return (
            <ul>
                {this.props.albums.map((album)=>
                    (<p key={album._id}>
                        <button onClick={() => {this.props.setCurrentAlbum(album.title)}}>
                            {album.title}
                        </button>
                    </p> ))}
            </ul>
        )
    }
}
